With Magento Google +1 button by MagePlace you can raise your sales using Google and its services. Simply install the extension on your Magento site, indicate what pages it can be placed at (like CMS pages, Category or Product pages), set up whether there should be a counter box of the +1 clicks. 

- Improve your ranking in search results;
- Let your visitors highlight your site in search results;
- Change button layout to fit your design;
- Choose what pages to display the button on.

The Google +1 Button supports Magento Community and Enterprise editions.
